Elu·es du Conseil départemental d'Eure-et-Loir, par canton, pour la mandature 2015-2021. Le jeu de données indique pour chaque élu·e les fonctions occupées au sein de l'assemblée ou des commissions permanente ou thématiques.
Pour plus d'information veuillez consulter [http://www.eurelien.fr/elus]( http://www.eurelien.fr/elus)
